"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Paget disease of bone (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H268263284\">",
"      <span class=\"h1\">",
"       What is Paget disease of bone?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Paget disease of bone is a disorder that causes problems with how the bones grow. It most often affects people older than 55.",
"     </p>",
"     <p>",
"      In healthy people, old bone breaks down and new bone replaces it. This happens slowly throughout life. In people with Paget disease (also called &ldquo;Paget&rsquo;s disease&rdquo;) of bone, the bones do not break down and regrow in the normal way. This can cause some of the bones to grow too big, form abnormal shapes, and be weaker than regular bones.",
"     </p>",
"     <p>",
"      Paget disease can affect different bones in different people. The bones most often affected are the skull, spine, pelvis, and arm and leg bones. Paget disease does not spread from 1 bone to another.",
"     </p>",
"     <p>",
"      There is also a type of breast cancer called Paget disease of the breast. This is",
"      <strong>",
"       not",
"      </strong>",
"      related to Paget disease of bone.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H268263299\">",
"      <span class=\"h1\">",
"       What are the symptoms of Paget disease of bone?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with Paget disease do not notice any symptoms. But some people do. Symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Pain",
"        </strong>",
"        &ndash; Bones affected by Paget disease sometimes hurt. The disease can also cause other problems, such as arthritis (when the affected bone is near a joint, such as the knee or hip), weakness, or numbness (if the bone puts pressure on a nerve).",
"       </li>",
"       <li>",
"        <strong>",
"         Changes in appearance",
"        </strong>",
"        &ndash; In some cases, the bones change so much that the changes are noticeable from the outside. For example, if the leg bones are affected, the changes might cause a limp or make the legs look curved. Paget disease of the skull can make the head grow bigger than normal.",
"       </li>",
"       <li>",
"        <strong>",
"         Fractures",
"        </strong>",
"        &ndash; Bones affected by Paget disease are weaker than normal. This makes them more likely to fracture (break).",
"       </li>",
"       <li>",
"        <strong>",
"         Hearing loss",
"        </strong>",
"        &ndash; In some cases, Paget disease can affect the skull bone near the ears. This can lead to hearing loss.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H268263314\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you have pain or other problems with your bones, your doctor or nurse can help figure out what is going on.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H268263329\">",
"      <span class=\"h1\">",
"       Is there a test for Paget disease of bone?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are a few different tests that your doctor or nurse can use to tell if you have Paget disease:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Blood test",
"        </strong>",
"        &ndash; People with Paget disease usually have a higher than normal level of a specific protein (called &ldquo;alkaline phosphatase&rdquo;) in the blood. A blood test can show this.",
"       </li>",
"       <li>",
"        <strong>",
"         Imaging tests",
"        </strong>",
"        &ndash; Imaging tests create pictures of the inside of the body. Bone scans and X-rays are 2 types of imaging tests that doctors use to check for bone problems.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H268263344\">",
"      <span class=\"h1\">",
"       How is Paget disease of bone treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many people with Paget disease do not need any treatment. But there are treatments that can help people who have symptoms. Even if you do not have any symptoms, your doctor might suggest treatment to keep your Paget disease from causing other problems.",
"     </p>",
"     <p>",
"      Treatments can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Medicines",
"        </strong>",
"        &ndash; There are medicines that can help prevent some of the bone problems caused by Paget disease. Some of these medicines come as pills, while others come as shots. If you start taking these medicines, your doctor or nurse will do blood tests every few months to see if they are working.",
"        <br/>",
"        <br/>",
"        If you take these medicines, it is important to get plenty of calcium and vitamin D. Your doctor or nurse can help you figure out how much you need. Lots of foods and drinks have calcium and vitamin D (",
"        <a class=\"graphic graphic_figure graphicRef79375 \" href=\"UTD.htm?18/13/18647\">",
"         figure 1",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        <strong>",
"         Treatments for other problems",
"        </strong>",
"        &ndash; Some people with Paget disease also have related problems, such as arthritis or pinched nerves. If treating your Paget disease does not help with these problems, your doctor or nurse might suggest pain medicines, such as",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        (sample brand names: Advil, Motrin) or",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?19/35/20021?source=see_link\">",
"         acetaminophen",
"        </a>",
"        (sample brand name: Tylenol). Your doctor or nurse might also suggest that you use a cane or try physical therapy.",
"       </li>",
"       <li>",
"        <strong>",
"         Surgery",
"        </strong>",
"        (to replace a knee or hip) can also help some people with severe arthritis.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H268263382\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. It might help to eat a healthy diet with plenty of calcium and vitamin D. Getting regular exercise can also help strengthen bones. Your doctor or nurse can help you figure out what kinds of exercise are safe for you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H268263397\">",
