"      Watson JC, Hadler SC, Dykewicz CA, et al, \"Measles, Mumps, and Rubella--Vaccine Use and Strategies for Elimination of Measles, Rubella, and Congenital Rubella Syndrome and Control of Mumps: Recommendations of the Advisory Committee on Immunization Practices (ACIP),\"",
