var outline_f11_59_12222=null;
var title_f11_59_12223="Contraindications and precautions to vaccines";
var content_f11_59_12223=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F70887&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F70887&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Contraindications and precautions* to commonly used vaccines",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Vaccine",
"       </td>",
"       <td class=\"subtitle1\">",
"        Contraindications",
"       </td>",
"       <td class=\"subtitle1\">",
"        Precautions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        DTaP",
"       </td>",
"       <td>",
"        <p>",
"         Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"        </p>",
"        <p>",
"         Encephalopathy (eg, coma, decreased level of consciousness, or prolonged seizures), not attributable to another identifiable cause, within 7 days of administration of previous dose of DTP or DTaP",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Progressive neurologic disorder, including infantile spasms, uncontrolled epilepsy, progressive encephalopathy; defer DTaP until neurologic status clarified and stabilized",
"        </p>",
"        <p>",
"         Temperature of &ge;105&deg;F (&ge;40.5&deg;C) within 48 hours after vaccination with a previous dose of DTP or DTaP",
"        </p>",
"        <p>",
"         Collapse or shock-like state (ie, hypotonic hyporesponsive episode) within 48 hours after receiving a previous dose of DTP/DTaP",
"        </p>",
"        <p>",
"         Seizure &le;3 days after receiving a previous dose of DTP/DTaP",
"        </p>",
"        <p>",
"         Persistent, inconsolable crying lasting &ge;3 hours within 48 hours after receiving a previous dose of DTP/DTaP",
"        </p>",
"        <p>",
"         GBS &lt;6 weeks after previous dose of tetanus toxoid-containing vaccine",
"        </p>",
"        <p>",
"         History of arthus-type hypersensitivity reactions after a previous dose of tetanus toxoid-containing vaccine; defer vaccination until at least 10 years have elapsed since the last tetanus toxoid-containing vaccine",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        DT, Td",
"       </td>",
"       <td>",
"        Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"       </td>",
"       <td>",
"        <p>",
"         GBS &lt;6 weeks after previous dose of tetanus toxoid-containing vaccine",
"        </p>",
"        <p>",
"         History of arthus-type hypersensitivity reactions after a previous dose of tetanus toxoid-containing vaccine; defer vaccination until at least 10 years have elapsed since the last tetanus-toxoid-containing vaccine",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Tdap",
"       </td>",
"       <td>",
"        <p>",
"         Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"        </p>",
"        <p>",
"         Encephalopathy (eg, coma, decreased level of consciousness, or prolonged seizures), not attributable to another identifiable cause, within 7 days of administration of previous dose of DTP, DTaP, or Tdap",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         GBS &lt;6 weeks after a previous dose of tetanus toxoid-containing vaccine",
"        </p>",
"        <p>",
"         Progressive or unstable neurological disorder, uncontrolled seizures, or progressive encephalopathy until a treatment regimen has been established and the condition has stabilized",
"        </p>",
"        <p>",
"         History of arthus-type hypersensitivity reactions after a previous dose of tetanus toxoid-containing vaccine; defer vaccination until at least 10 years have elapsed since the last tetanus toxoid-containing vaccine",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        IPV",
"       </td>",
"       <td>",
"        Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"       </td>",
"       <td>",
"        <p>",
"         Pregnancy",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        MMR",
"        <sup>",
"         &bull;&Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        <p>",
"         Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"        </p>",
"        <p>",
"         Pregnancy",
"        </p>",
"        <p>",
"         Known severe immunodeficiency (eg, from hematologic and solid tumors, receipt of chemotherapy, congenital immunodeficiency, or long-term immunosuppressive therapy",
"         <sup>",
"          &loz;",
"         </sup>",
"         or patients with HIV infection who are severely immunocompromised)",
"         <sup>",
"          &Delta;",
"         </sup>",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Recent (&le;11 months) receipt of antibody-containing blood product (specific interval depends on product)",
"         <sup>",
"          [1]",
"         </sup>",
"        </p>",
"        <p>",
"         History of thrombocytopenia or thrombocytopenic purpura",
"        </p>",
"        <p>",
"         Need for tuberculin skin testing",
"         <sup>",
"          &sect;",
"         </sup>",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Hib",
"       </td>",
"       <td>",
"        <p>",
"         Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"        </p>",
"        <p>",
"         Age &lt;6 weeks",
"        </p>",
"       </td>",
"       <td>",
"        Moderate or severe acute illness with or without fever",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Hepatitis B",
"       </td>",
"       <td>",
"        Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"       </td>",
"       <td>",
"        <p>",
"         Infant weight &lt;2000 g",
"         <sup>",
"          &yen;",
"         </sup>",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Hepatitis A",
"       </td>",
"       <td>",
"        Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"       </td>",
"       <td>",
"        <p>",
"         Pregnancy",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Varicella",
"       </td>",
"       <td>",
"        <p>",
"         Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"        </p>",
"        <p>",
"         Known severe immunodeficiency (eg, from hematologic and solid tumors, receipt of chemotherapy, congenital immunodeficiency, or long-term immunosuppressive therapy",
"         <sup>",
"          &yen;",
"         </sup>",
"         or patients with HIV infection who are severely immunocompromised)",
"         <sup>",
"          &Delta;",
"         </sup>",
"        </p>",
"        <p>",
"         Pregnancy",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Recent (&le;11 months) receipt of antibody-containing blood product (specific interval depends on product)",
"         <sup>",
"          ",
"         </sup>",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        PCV",
"       </td>",
"       <td>",
"        Severe allergic reaction (eg, anaphylaxis) after a previous dose (of PCV7, PCV13, or any diphtheria toxoid-containing vaccine) or to a component of a vaccine (PCV7, PCV13, or any diphtheria toxoid-containing vaccine)",
"       </td>",
"       <td>",
"        Moderate or severe acute illness with or without fever",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        TIV",
"       </td>",
"       <td>",
"        Severe allergic reaction (eg, anaphylaxis) after previous dose or to vaccine component, including egg protein",
"       </td>",
"       <td>",
"        <p>",
"         GBS &lt;6 weeks after a previous dose of influenza vaccine",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        LAIV",
"       </td>",
"       <td>",
"        <p>",
"         Severe allergic reaction (eg, anaphylaxis) after previous dose or to vaccine component, including egg protein",
"        </p>",
"        <p>",
"         Pregnancy",
"        </p>",
"        <p>",
"         Immunosuppression",
"        </p>",
"        <p>",
"         Certain chronic medical conditions",
"         <sup>",
"          [2]",
"         </sup>",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         GBS &lt;6 weeks after a previous dose of influenza vaccine",
"        </p>",
"        <p>",
"         Moderate of severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        PPSV",
"       </td>",
"       <td>",
"        Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"       </td>",
"       <td>",
"        Moderate or severe acute illness with or without fever",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        MCV4",
"       </td>",
"       <td>",
"        Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"       </td>",
"       <td>",
"        Moderate or severe acute illness with or without fever",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        MPSV4",
"       </td>",
"       <td>",
"        Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"       </td>",
"       <td>",
"        Moderate or severe acute illness with or without fever",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        HPV",
"       </td>",
"       <td>",
"        Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"       </td>",
"       <td>",
"        <p>",
"         Pregnancy",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Rotavirus",
"       </td>",
"       <td>",
"        <p>",
"         Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"        </p>",
"        <p>",
"         SCID",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Altered immunocompetence other than SCID",
"        </p>",
"        <p>",
"         History of intussusception",
"        </p>",
"        <p>",
"         Chronic gastrointestinal disease",
"         <sup>",
"          [3]",
"         </sup>",
"        </p>",
"        <p>",
"         Spina bifida or bladder exstrophy",
"         <sup>",
"          [3]",
"         </sup>",
"        </p>",
"        <p>",
"         Moderate or severe acute illness with or without fever",
"        </p>",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Zoster",
"       </td>",
"       <td>",
"        <p>",
"         Severe allergic reaction (eg, anaphylaxis) after a previous dose or to a vaccine component",
"        </p>",
"        <p>",
"         Substantial suppression of cellular immunity",
"        </p>",
"        <p>",
"         Pregnancy",
"        </p>",
"       </td>",
"       <td>",
"        Moderate or severe acute illness with or without fever",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     DT: diphtheria and tetanus toxoids; DTaP: diphtheria and tetanus toxoids and acellular pertussis; GBS: Guillian-Barr&eacute; syndrome; HBsAg: hepatitis B surface antigen; Hib: Haemophilus influenzae type b; HIV: human immunodeficiency virus; HPV: human papillomavirus; IPV: inactivated poliovirus; LAIV: live, attenuated influenza vaccine; MCV4: quadrivalent meningococcal conjugate vaccine; MMRV: measles, mumps, rubella, and varicella; MPSV4: quadrivalent meningococcal polysaccharide vaccine; PCV: pneumococcal conjugate vaccine; PPSV: pneumococcal polysaccharide vaccine; SCID: severe combined immunodeficiency; Td: tetanus and diphtheria toxoids; Tdap: tetanus toxoid, reduced diphtheria toxoid, and acellular pertussis; TIV: trivalent inactivated influenza vaccine.",
"     <br>",
"      * Events or conditions listed as precautions should be reviewed carefully. Benefits of and risks for administering a specific vaccine to a person under these circumstances should be considered. If the risk from the vaccine is believed to outweigh the benefit, the vaccine should not be administered. If the benefit of vaccination is believed to outweigh the risk, the vaccine should be administered. Whether and when to administer DTaP to children with proven or suspected underlying neurologic disorders should be decided on a case-by-case basis.",
"      <br>",
"       <span class=\"bullet\">",
"        &bull;",
"       </span>",
"       HIV-infected children may receive varicella and measles vaccine if CD4",
"       <sup>",
"        +",
"       </sup>",
"       T-lymphocyte count is &gt;15 percent",
"       <sup>",
"        [4]",
"       </sup>",
"       .",
"       <br>",
"        &Delta; MMR and varicella vaccines can be administered on the same day. If not administered on the same day, these vaccines should be separated by at least 28 days.",
"        <br>",
"         <span class=\"lozenge\">",
"          &loz;",
"         </span>",
"         Substantially immunosuppressive steroid dose is considered to be &ge;2 weeks of daily receipt of 20 mg or 2 mg/kg body weight of prednisone or equivalent.",
"         <br>",
"          &sect; Measles vaccination might suppress tuberculin reactivity temporarily. Measles-containing vaccine can be administered on the same day as tuberculin skin testing. If testing cannot be performed until after the day of MMR vaccination, the test should be postponed for &ge;4 weeks after the vaccination. If an urgent need exists to skin test, do so with the understanding that reactivity might be reduced by the vaccine.",
"          <br>",
"           &yen; Hepatitis B vaccination should be deferred for infants weighing &lt;2000 g if the mother is documented to be HBsAg-negative at the time of the infant's birth. Vaccination can commence at chronological age 1 month or at hospital discharge. For infants born to HBsAg-positive women, hepatitis B immune globulin and hepatitis B vaccine should be administered within 12 hours after birth, regardless of weight.",
"           <br>",
"             Vaccine should be deferred for the appropriate interval if replacement immune globulin products are being administered.",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Centers for Disease Control and Prevention. General Recommendations on Immunization: Recommendations of the Advisory Committee on Immunization Practices (ACIP). MMWR Recomm Rep 2011; 60(RR-2):1.",
"       </li>",
"       <li>",
"        Centers for Disease Control and Prevention. Prevention and control of seasonal influenza with vaccines: recommendations of the Advisory Committee on Immunization Practices (ACIP), 2010. MMWR Recomm Rep 2010; 59(RR-8).",
"       </li>",
"       <li>",
"        Centers for Disease Control and Prevention. Prevention of rotavirus gastroenteritis among infants and children: recommendations of the Advisory Committee on Immunization Practices. MMWR Recomm Rep 2009; 58(RR-2).",
"       </li>",
"       <li>",
"        American Academy of Pediatrics. Passive immunization. In: Red book: 2009 report of the committee on infectious diseases, Pickering LK (Ed), 28th ed, Elk Grove Village, IL, American Academy of Pediatrics 2009.",
"       </li>",
"      </ol>",
"      Centers for Disease Control and Prevention. General Recommendations on Immunization: Recommendations of the Advisory Committee on Immunization Practices (ACIP). MMWR Recomm Rep 2011; 60(RR-2):1.",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
